(function(M) {

	function Intro() {
		this._isPlaying = false;
		this._logo = new Image();
		this._logo.src = "data:image/png;base64,";
	}

	Intro.prototype.play = function() {

		this._isPlaying = true;
		
		this._layers = M._gameLayers;
		this._objects = M._gameObjects;
		
		var self = this,
			canvas = M.frontBuffer.canvas,
			foreColor = "white",
			backgroundColor = "black",
			oldBackground = canvas.style.getPropertyValue("background"),
			layer,
			s = new M.renderers.Sprite(this._logo),
			t1 = new M.renderers.Text(),
			t2 = new M.renderers.Text(),
			t3 = new M.renderers.Text(),
			t4 = new M.renderers.Text(),
			fadeInTime = 3,
			scaleDownTime = 0.5,
			stillTime = 2000,
			scale = {
				x: canvas.width / 640,
				y: canvas.height / 480
			};

		M._gameLayers = new Array();
		M._gameObjects = new Array();

		layer = M.createGameLayer();

		if ( scale.x > scale.y ) {
			scale = scale.x;
		} else {
			scale = scale.y;
		}

		s.setLocation(canvas.width / 2, canvas.height / 2);
		s.setScale( scale * 0.5, scale * 0.5 );
		s.fadeIn(fadeInTime, function() {
			window.setTimeout(function() {
				s.scaleDown(0, 0, scaleDownTime, function() {
					M.removeGameLayer(layer);
					canvas.style.setProperty("background", oldBackground);
					M._gameLayers = self._layers;
					M._gameObjects = self._objects;
				});
				t1.scaleDown(0, 0, scaleDownTime);
				t2.scaleDown(0, 0, scaleDownTime);
				t3.scaleDown(0, 0, scaleDownTime);
				t4.fadeOut(scaleDownTime);
			}, stillTime);
		});

		t1.setText("POWERED BY");
		t1.setFamily("Impact");
		t1.setSize("40px");
		t1.setFillStyle(foreColor);
		t1.setLocation( s.getX(), s.getTop() - 20 * scale );
		t1.fadeIn(fadeInTime);
		t1.setScale(scale, scale);

		t2.setText("MATCH");
		t2.setFamily("Impact");
		t2.setSize("48px");
		t2.setFillStyle(foreColor);
		t2.setLocation( s.getX(), s.getBottom() + 25 * scale );
		t2.fadeIn(fadeInTime);
		t2.setScale(scale, scale);

		t3.setText("HTML5 Game Engine");
		t3.setFamily("Impact");
		t3.setSize("16px");
		t3.setFillStyle(foreColor);
		t3.setLocation( s.getX(), s.getBottom() + 60 * scale );
		t3.fadeIn(fadeInTime);
		t3.setScale(scale, scale);

		t4.setText("Match and Match logo are trademarks of Puzzling Ideas. All rights reserved");
		t4.setFamily("Verdana");
		t4.setSize("7px");
		t4.setFillStyle(foreColor);
		t4.setLocation( s.getX(), canvas.height - 10 * scale );
		t4.fadeIn(fadeInTime);

		canvas.style.setProperty("background", backgroundColor);
		layer.push(s);
		layer.push(t1);
		layer.push(t2);
		layer.push(t3);
		layer.push(t4);

	};

	M._intro = new Intro();

})(window.Match);